/* Model creation/destruction functions */

void MODEL_mkMergeSort::create_model(tSimStateHdl simHdl, bool master)
{
  sim_hdl = simHdl;
  init_reset_request_counters(sim_hdl);
  mkMergeSort_instance = new MOD_mkMergeSort(sim_hdl, "top", NULL);
  bk_get_or_define_clock(sim_hdl, "CLK");
  if (master)
  {
    bk_alter_clock(sim_hdl, bk_get_clock_by_name(sim_hdl, "CLK"), CLK_LOW, false, 0llu, 5llu, 5llu);
    bk_use_default_reset(sim_hdl);
  }
  bk_set_clock_event_fn(sim_hdl,
			bk_get_clock_by_name(sim_hdl, "CLK"),
			schedule_posedge_CLK,
			NULL,
			(tEdgeDirection)(POSEDGE));
  (mkMergeSort_instance->set_clk_0)("CLK");
}
void MODEL_mkMergeSort::destroy_model()
{
  delete mkMergeSort_instance;
  mkMergeSort_instance = NULL;
}
void MODEL_mkMergeSort::reset_model(bool asserted)
{
  (mkMergeSort_instance->reset_RST_N)(asserted ? (tUInt8)0u : (tUInt8)1u);
}
void * MODEL_mkMergeSort::get_instance()
{
  return mkMergeSort_instance;
}

/* Fill in version numbers */
void MODEL_mkMergeSort::get_version(unsigned int *year,
				    unsigned int *month,
				    char const **annotation,
				    char const **build)
{
  *year = 2017u;
  *month = 7u;
  *annotation = "A";
  *build = "1da80f1";
}

/* Get the model creation time */
time_t MODEL_mkMergeSort::get_creation_time()
{
  
  /* Thu Oct 25 11:57:57 UTC 2018 */
  return 1540468677llu;
}

/* Control run-time licensing */
tUInt64 MODEL_mkMergeSort::skip_license_check()
{
  return 0llu;
}

/* State dumping function */
void MODEL_mkMergeSort::dump_state()
{
  (mkMergeSort_instance->dump_state)(0u);
}

/* VCD dumping functions */
MOD_mkMergeSort & mkMergeSort_backing(tSimStateHdl simHdl)
{
  static MOD_mkMergeSort *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkMergeSort(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mkMergeSort::dump_VCD_defs()
{
  (mkMergeSort_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkMergeSort::dump_VCD(tVCDDumpType dt)
{
  (mkMergeSort_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mkMergeSort_backing(sim_hdl));
}
